import React from "react";
import ReactDOM from "react-dom";
import { BrowserRouter, Route, Switch, Redirect } from "react-router-dom";

import "@fortawesome/fontawesome-free/css/all.min.css";


import "assets/styles/tailwind.css";


// layouts

import Admin from "layouts/Admin.js";
import Auth from "layouts/Auth.js";
import Technicien from "layouts/Admin.js";


// views without layouts

import Landing from "views/Landing.js";
import Profile from "views/Profile.js";
import Index from "views/Index.js";
import Register from "views/Register.js";
import Login from "views/Login.js";
import Ticket from "views/Ticket.js";
import Test from "views/Test.js";
import MyTickets from "views/MyTickets";
ReactDOM.render(
  <BrowserRouter>
    <Switch>
      {/* add routes with layouts */}
      <Route path="/admin" component={Admin} />
      <Route path="/technicien" component={Technicien} />
      <Route path="/auth" component={Auth} />
      {/* add routes without layouts */}
      <Route path="/landing" exact component={Landing} />
      <Route path="/profile" exact component={Profile} />
      <Route path="/Register" exact component={Register} />
      <Route path="/homepage" exact component={Index} />
      <Route path="/Ticket" exact component={Ticket} />
      <Route path="/" exact component={Login} />
      <Route path="/Test" exact component={Test} />
      <Route path="/MyTickets" exact component={MyTickets} />
    

      
      {/* add redirect for first page */}
      <Redirect from="*" to="/" />
    </Switch>
  </BrowserRouter>,
  document.getElementById("root")
);
